export class TextDecoder {
    // eslint-disable-next-line no-useless-constructor
    constructor(_) {
        // nothing
    }
    decode(value) {
        let result = '';
        for (let i = 0; i < value.length; i++) {
            result += String.fromCharCode(value[i]);
        }
        return result;
    }
}
